import Container from 'react-bootstrap/Container';

function FooterComponent() {
    return (
        <footer className="py-5">
            <Container>
                <div className="row">
                    <div className="col-12 col-md-6"></div>
                </div>
            </Container>
        </footer>
    );
}

export default FooterComponent;
